import React from 'react';
import banner from '../../assets/banner.png'
import 'styles.css'
import Header from '../../components/Header'


function Inicial() {
  return (
    <>
    <Header/>

    <img src={banner} alt="banner"/>
    </>
  )
}
export default Inicial;
